import React from 'react';
import { Element } from 'react-scroll';
import classes from './Work.module.css';
function Work() {
	return (
		<Element name="work">
			<div className="container">
				<div className="row">
					<div className="col-12">
						<div className="d-flex justify-content-center">
							<div className={classes.kkw}>
								<img style={{ width: '120px' }} src="/static/numberone.png" />
								<div className={classes.divtext}>
									<h2 className={classes.worktitle}>کیم کارداشیان بیوتی</h2>
									<p className={classes.worktext}>فروشگاه اینترنتی لوازم آرایشی</p>
									<div className="d-flex justify-content-end">
										<button className={classes.view}>مشاهده</button>
									</div>
								</div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</Element>
	);
}

export default Work;
